const canvas = document.querySelector("canvas");
const ctx = canvas.getContext("2d");
const slider = document.getElementById("resulotion");
const slider_label = document.getElementById("res_label");



let img = new Image();
img.src = "data:image/jpeg;base64,"

class Cell{
    constructor(x,y,color , symbol){
        this.x = x ;
        this.y = y ;
        this.color = color ;
        this.symbol = symbol ;
    }
    print(ctx){
      ctx.fillStyle = "green" ;
        ctx.fillText(this.symbol , this.x +1 , this.y + 1)
        ctx.fillStyle = this.color ;
        ctx.fillText(this.symbol , this.x , this.y)
    }
}

class ascii {
  #ctx;
  #pixels = [];
  #cell_array = [];
  #width;
  #height;

  constructor(ctx, img) {
    this.#ctx = ctx;
    this.#width = img.width;
    this.#height = img.height;
    this.#ctx.drawImage(img, 0, 0);
    this.#pixels = this.#ctx.getImageData(0, 0, this.#width, this.#height);
  }

  #get_symbol(total){
    if(total > 225) return '#';
    else if( total >200) return '@' ;
    else if( total >180) return '$' ;
    else if( total >160) return '&' ;
    else if( total >140) return '%' ;
    else if( total >120) return '?' ;
    else if( total >100) return '!' ;
    else if( total >80) return '=' ;
    else if( total >60) return '+' ;
    else if( total >40) return ',' ;
    else if( total >20) return '.' ;
  }

  #get_pixels(cell_size) {
    this.#cell_array = []
    for (let y = 0; y < this.#pixels.height; y += cell_size) {
      for (let x = 0; x < this.#pixels.width; x += cell_size) {
        const xPos = x * 4;
        const yPos = y * 4;
        const pos = (yPos * this.#pixels.width) + xPos;
        if (this.#pixels.data[pos + 3] > 128) {
          const red = this.#pixels.data[pos];
          const blue = this.#pixels.data[pos + 1];
          const green = this.#pixels.data[pos + 2];
          const total = red + blue + green;
          const color = "rgb(" + red + ',' + blue + "," + green + ')';
          const symbol = this.#get_symbol(total / 3);
          if(total > 128){
            this.#cell_array.push(new Cell(x , y , color ,symbol));
          }
        }
      }
    }
  }

  draw(cell_size){
    this.#ctx.clearRect(0,0,this.#width , this.#height)
    this.#get_pixels(cell_size);
    for(let i=0 ; i < this.#cell_array.length ; i++){
      this.#cell_array[i].print(this.#ctx)
    }
  }
    
}

img.onload = function initialize() {
  canvas.width = img.width;
  canvas.height = img.height;
  let effect = new ascii(ctx, img);

  slider.addEventListener("input", () => {
  slider_label.innerHTML = "resolution " + slider.value + "px";
  if(slider.value == 1){
    slider_label.innerHTML = "Original photo";
    ctx.drawImage(img,0,0);
  }
  else{
    effect.draw(parseInt(slider.value))
  }
});
document.addEventListener("keydown", (event) => {
  let step = 1; // Define the increment/decrement step
  let newValue;
  console.log(event.key);
  if (event.key === "d") {
    newValue = parseInt(slider.value, 10) + step;
    slider.value = Math.min(newValue, slider.max); // Ensure it doesn't exceed max
  } else if (event.key === "a") {
    newValue = parseInt(slider.value, 10) - step;
    slider.value = Math.max(newValue, slider.min); // Ensure it doesn't go below min
  }

  if(slider.value == 1){
    slider_label.innerHTML = "Original photo";
    ctx.drawImage(img,0,0);
  }
  else{
    effect.draw(parseInt(slider.value))
  }

  // Update label after changing value
  slider_label.innerHTML = "resolution " + slider.value + "px";
});
};
